import React from 'react';
import styled from 'styled-components';

const EditFormWrapper = styled.div``;
const Form = styled.form``;
const InputWrapper = styled.div``;
const DetailEditForm = () => {
	return (
		<EditFormWrapper>
			<Form>
				<InputWrapper>
					<label>직업</label>
					<input placeholder="직업"></input>
				</InputWrapper>
				<InputWrapper>
					<label>지역</label>
					<input placehoder="지역"></input>
				</InputWrapper>
				<InputWrapper>
					<label>페이스북 주소</label>
					<input placeholder="페이스북 주소"></input>
				</InputWrapper>
				<InputWrapper>
					<label>인스타그램 주소</label>
					<input placeholder="인스타그램 주소">인스타그램 주소</input>
				</InputWrapper>
			</Form>
		</EditFormWrapper>
	);
};

export default DetailEditForm;
